import React from 'react';

const nuberWithCommas = (x) => {
  return x.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",");
},

HomeListingCard = ({
  imageURL,
  homeName,
  startingPrice,
  beds,
  baths,
  sqft,
  isMultiSection
}) => {
  const price
  //if (!homeName) return (null);
  return (
    <React.Fragment>
      <figure>
        <img src={imageURL} />
      </figure>
      <div>
        <h5>{homeName}</h5>
        <p>{beds} beds • {baths} baths • {nuberWithCommas(sqft)} sq. ft.</p>
      </div>
      <div>
        <p>Starting Price</p>
        <p>${numberWithCommas(startingPrice)}</p>
      </div>
    </React.Fragment>
  )
};

export default HomeListingCard;
